import React from 'react';

class Stocklevel extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      level: '',
    };
  }

  componentDidMount() {
    const url = `https://api.nike.com/deliver/available_skus/v1/${this.props.props}`;
    fetch(url)
      .then((res) => res.json)
      .then((json) => {
        const level = json.level;
        console.log(level);
        this.setState({ level: level });
      });
  }

  render() {
    return <p>{this.state.level}</p>;
  }
}

